    of the occurrence or expected occurrence of specified en route weather phenomena
    which may affect the safety of aircraft operations, but at intensities lower than
    those which require the issuance of a SIGMET. AIRMETs are intended to inform all
    pilots, but especially Visual Flight Rules pilots and operators of sensitive aircraft,
    of potentially hazardous weather phenomena. Freezing level information is included.",ntt"format":
